import React, { useState, useEffect } from 'react';
import performanceDetector from '../utils/performanceDetection';
import './AnimatedCircularFrame.css';

const AnimatedCircularFrame = ({ children, isLoading = false, className = '' }) => {
  const [useFallback, setUseFallback] = useState(false);
  const [isInitialized, setIsInitialized] = useState(false);

  useEffect(() => {
    const checkPerformance = async () => {
      // Check if we should use fallback mode
      const shouldFallback = performanceDetector.shouldUseFallback();
      setUseFallback(shouldFallback);
      setIsInitialized(true);

      if (process.env.NODE_ENV === 'development') {
        console.log('AnimatedCircularFrame: Using fallback mode:', shouldFallback);
      }
    };

    checkPerformance();
  }, []);

  // Don't render until performance check is complete
  if (!isInitialized) {
    return (
      <div className={`circular-frame-container ${className}`}>
        <div className="circular-frame static">
          <div className="frame-content">
            {children}
          </div>
        </div>
      </div>
    );
  }

  const frameClass = useFallback ? 'static' : 'animated';
  const loadingClass = isLoading ? 'loading' : '';

  return (
    <div className={`circular-frame-container ${className}`}>
      {/* Outer rotating ring */}
      <div className={`circular-frame ${frameClass} ${loadingClass}`}>
        {/* Inner static content area */}
        <div className="frame-content">
          {children}
        </div>

        {/* Animated elements - only render if not using fallback */}
        {!useFallback && (
          <>
            {/* Primary rotating ring */}
            <div className="rotating-ring primary">
              <svg viewBox="0 0 200 200" className="ring-svg">
                <circle
                  cx="100"
                  cy="100"
                  r="95"
                  fill="none"
                  stroke="url(#primaryGradient)"
                  strokeWidth="2"
                  strokeLinecap="round"
                  strokeDasharray="20 10"
                />
                <defs>
                  <linearGradient id="primaryGradient" x1="0%" y1="0%" x2="100%" y2="100%">
                    <stop offset="0%" stopColor="#00ff99" stopOpacity="0.8" />
                    <stop offset="50%" stopColor="#00cc66" stopOpacity="0.6" />
                    <stop offset="100%" stopColor="#00ff99" stopOpacity="0.4" />
                  </linearGradient>
                </defs>
              </svg>
            </div>

            {/* Secondary counter-rotating ring */}
            <div className="rotating-ring secondary">
              <svg viewBox="0 0 180 180" className="ring-svg">
                <circle
                  cx="90"
                  cy="90"
                  r="85"
                  fill="none"
                  stroke="url(#secondaryGradient)"
                  strokeWidth="1"
                  strokeLinecap="round"
                  strokeDasharray="15 25"
                />
                <defs>
                  <linearGradient id="secondaryGradient" x1="0%" y1="0%" x2="100%" y2="100%">
                    <stop offset="0%" stopColor="#00ff99" stopOpacity="0.3" />
                    <stop offset="100%" stopColor="#00cc66" stopOpacity="0.1" />
                  </linearGradient>
                </defs>
              </svg>
            </div>

            {/* Pulsing dots */}
            <div className="pulsing-dots">
              <div className="dot dot-1"></div>
              <div className="dot dot-2"></div>
              <div className="dot dot-3"></div>
              <div className="dot dot-4"></div>
            </div>
          </>
        )}

        {/* Static fallback glow effect */}
        {useFallback && (
          <div className="static-glow-ring">
            <svg viewBox="0 0 200 200" className="ring-svg">
              <circle
                cx="100"
                cy="100"
                r="95"
                fill="none"
                stroke="url(#staticGradient)"
                strokeWidth="2"
                strokeLinecap="round"
              />
              <defs>
                <linearGradient id="staticGradient" x1="0%" y1="0%" x2="100%" y2="100%">
                  <stop offset="0%" stopColor="#00ff99" stopOpacity="0.6" />
                  <stop offset="50%" stopColor="#00cc66" stopOpacity="0.4" />
                  <stop offset="100%" stopColor="#00ff99" stopOpacity="0.2" />
                </linearGradient>
              </defs>
            </svg>
          </div>
        )}
      </div>

      {/* Performance indicator (development only) */}
      {process.env.NODE_ENV === 'development' && (
        <div className="performance-indicator">
          {useFallback ? '🔋 Fallback' : '⚡ Animated'}
        </div>
      )}
    </div>
  );
};

export default AnimatedCircularFrame;
